import React from "react";
import Card from "./Card";
import contacts from "../contacts";
import Avatar from "./Avatar";


function getCard(contact){
  return (
    <Card 
      title={contact.title}
      title={contact.title}
      name={contact.name}
      img={contact.imgURL}
      phone={contact.phone}
      email={contact.email}
    />
  );
}

function App() {
  return (
    <div>
      <h1 className="heading">My First React App</h1>
      {contacts.map(getCard)}
    </div>
  );
}

export default App;
